<script>
var rate = 8000 

var audio_context = undefined

var snd = undefined

function playSnd(buf){
  if(!audio_context) audio_context = new AudioContext();
  var source  = audio_context.createBuffer(1,buf.length,rate);
  source.copyToChannel(buf,0,0);
  var oup = audio_context.createBufferSource();
  oup.buffer = source;
  oup.connect(audio_context.destination);
  oup.start(0);
}

function makeSound(fr){
	if(fr==undefined) fr = 500
	let snd = new Float32Array(10000)
	let a =1
	let th =0
	let dth = Math.PI*2*fr/rate
	const dth0 = Math.PI*4*fr/rate
	for(let k=0;k<snd.length;k++){
		snd[k] = sat(0.1*th,0,1)*Math.sin(th)*a
		th += dth
		dth += 0.001*(dth0-dth)
		a *=0.993
	}
	return snd
}

//---------------------
// ** switch to fullscreen mode 

function fullScreen(e){
    e = e||document.body;
	if(e.webkitRequestFullScreen)
		e.webkitRequestFullScreen();
	else if(e.mozRequestFullScreen)
		e.mozRequestFullScreen();
	else if(e.msRequestFullScreen)
		e.msRequestFullScreen();
}   

//----------------------------------------------
// ** return a random number in [a,b[
//    if b is undefined: return a number in [-a,a[
//    if a and b are undefined: return a number in [-1,1[

function rnd(a,b){
	if(a==undefined){a=1;b=1}
	else if(b==undefined){b=-a}
	return a+(b-a)*Math.random();
}

function rndInt(a,b){
	return Math.floor(rnd(a,b))
}

function rndDecide(p){
	return (rnd(0,1)<=p)
}

function sat(v,a,b){
	if(v<=a)return a
	if(v>=b)return b
	return v
}


const vertexShader = 
`
attribute vec2 a_Position;
	
attribute vec4 color;

attribute vec2 texco;

varying vec2 texc;

varying vec2 pos;

varying vec4 clr;

void main(){
   
   vec2 cf = vec2(1.0, 16.0/9.0);
   
   gl_Position =  vec4(a_Position*cf,0.0,1.0);
   
   clr  = color;
   
   pos  = a_Position;
   
   texc = texco;
   
}
	
`

}

`

	//--------------------------------
	// ** newBuffer: creates a buffer and bind it to attribute 'name'
    function newBuffer(name,size){
		var p = ctx.getAttribLocation(prog,name);
		var buffer = ctx.createBuffer(); 
		ctx.bindBuffer(ctx.ARRAY_BUFFER,buffer); 
		ctx.enableVertexAttribArray(p);
		ctx.vertexAttribPointer(p,size,ctx.FLOAT,false,0,0); 
		return buffer;
	} 	
	
	//---------------------------------
	// ** setBuffer: sets the vbalues in buffer 
    function setBuffer(buffer,values){
		ctx.bindBuffer(ctx.ARRAY_BUFFER,buffer);
		ctx.bufferData(ctx.ARRAY_BUFFER,values,ctx.STATIC_DRAW);
	}

		console.log(ctx);
		var  VShader = createShader(ctx,ctx.VERTEX_SHADER,vertexShader);
		var  FShader = createShader(ctx,ctx.FRAGMENT_SHADER,fragmentShader);
	    prog = ctx.createProgram();
		ctx.attachShader(prog,VShader);
		ctx.attachShader(prog,FShader);
		ctx.linkProgram(prog);
		var res = ctx.getProgramParameter(prog,ctx.LINK_STATUS);
		if(res)
		    console.log("shaders compiled successfuly.");
		else {
		console.log("error compiling shaders!");
		return;
		}
		ctx.viewport(0,0,ctx.canvas.width,ctx.canvas.height);
		ctx.useProgram(prog);
		
	}

	//--------------------------------
	
	function createShader(gl,type,src){
	     var shader = gl.createShader(type);
		 gl.shaderSource(shader,src);
		 gl.compileShader(shader);
		 var res = gl.getShaderParameter(shader,gl.COMPILE_STATUS);
		 if(res)return shader;
	}
	
    
//---------------------------------
// ** newTex: creates a texture from an image object
function newTex(image){
 let tex = ctx.createTexture();
 ctx.bindTexture(ctx.TEXTURE_2D,tex);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_WRAP_S, ctx.CLAMP_TO_EDGE);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_WRAP_T, ctx.CLAMP_TO_EDGE);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_MIN_FILTER, ctx.LINEAR);
 ctx.texParameteri(ctx.TEXTURE_2D, ctx.TEXTURE_MAG_FILTER, ctx.LINEAR);
 ctx.texImage2D(ctx.TEXTURE_2D,0,ctx.RGBA,image.width, image.height, 0, ctx.RGBA, ctx.UNSIGNED_BYTE,new Uint8Array(image.data)); 
 return tex;
}

 

var aspectRatio,
    World={},
	Camera={},
	CollisionBlocks=[]
	Map=[]
	
function initWorld(width,height){
	aspectRatio = can.height *1.0/ can.width
	World.width = width
	World.height = height
	World.hWidth = width/2
	World.hHeight = height/2
	Camera.x = 0
	Camera.y = 0
	Camera.w = 0.5
	Camera.h = Camera.w * aspectRatio
	Camera.maxX = World.hWidth  - Camera.w
	Camera.maxY = World.hHeight - Camera.h
	
	//-- create collision blocks
	for(let k=0;k<40;k++){
		let p = new Sprite(
			Math.round(rnd(World.hWidth)/0.3)*0.3,
			Math.round(rnd(World.hHeight)/0.3)*0.3,
			0.3,0.3,[0.5,0.5,0.75,0.75]
		)
		p.color=[1,0.9,0.5,1]
		p.th=0
		CollisionBlocks.push( p )	
	}
}

function updateCamera(player)
{
	if(player.x-Camera.x>Camera.w)
		Camera.x=player.x-Camera.w
	else
	if(player.x-Camera.x<-Camera.w)
		Camera.x=player.x+Camera.w
	
	if(player.y-Camera.y>Camera.h)
		Camera.y=player.y-Camera.h
	else
	if(player.y-Camera.y<-Camera.h)
		Camera.y=player.y+Camera.h
	
	Camera.x = sat( Camera.x, -Camera.maxX,Camera.maxX)
	Camera.y = sat( Camera.y, -Camera.maxY,Camera.maxY)
}

function Sprite(x,y,w,h,tx){
	this.tx = tx
	this.x  = x
	this.y  = y
	this.vx = 0
	this.vy = 0
	this.ax = 0
	this.ay = 0
	this.width = w
	this.height = h
	this.color = [1,1,1,1]
	this.th = rnd(Math.PI)
	
	this.detectWorldEdge=function(){
		const mx = World.hWidth-this.width/2
		const my = World.hHeight-this.height/2
		this.x = sat(this.x,-mx,mx)
		this.y = sat(this.y,-my,my)
	}
	
	this.distTo=function(sp){
		let a = sp.x-this.x
		let b = sp.y-this.y
		return Math.pow(a*a+b*b,0.5)
	}
	
	this.collides=function(sp){
		return (this.distTo(sp)<(sp.width+this.width)*0.5)
	}
	
	this.checkCollision=function(){
		for(let k=0;k<CollisionBlocks.length;k++)
			if(this.collides(CollisionBlocks[k]))
					return CollisionBlocks[k]
		return undefined
	}
		
}

//--------------------------------------------
// add sprite vertices to vertex buffer 
// and add colors & texture coordinates to attribute buffers

function addSpriteToBuf(sprite){
	let x = sprite.x - Camera.x
	let y = sprite.y - Camera.y
	let w = sprite.width *0.5
	let h = sprite.height*0.5
	let c = Math.cos(sprite.th )  
	let s = Math.sin(sprite.th )
	let px =  c*w-s*h
	let py =  s*w+c*h
	let qx = -c*w-s*h
	let qy = -s*w+c*h
	vArr=vArr.concat([
					x+px,y+py,
					x+qx,y+qy,
					x-px,y-py,
					x+px,y+py,
					x-px,y-py,
					x-qx,y-qy 
					])
	
    tArr=tArr.concat([sprite.tx[2],sprite.tx[1],
					sprite.tx[0],sprite.tx[1],
					sprite.tx[0],sprite.tx[3],
					sprite.tx[2],sprite.tx[1],
					sprite.tx[0],sprite.tx[3],
					sprite.tx[2],sprite.tx[3]
					])					
    for(let k=0;k<6;k++)					
	cArr=cArr.concat(sprite.color)
}

function drawCollisionBlocks(){
	for(let k=0;k<CollisionBlocks.length;k++)
		addSpriteToBuf(CollisionBlocks[k])
}

// ** Globals

var animOn = false;
var then = 0; 
const sp=[]
//-- sprite sheet divisions
	const txPos=[
	    [0,0,0.25,0.25],
		[0.25,0,0.5,0.25],
		[0,0.25,0.25,0.5],
		[0.5,0,1,0.5],
		[0.25,0.25,0.5,0.5],
		[0.25,0.5,0.5,0.75]
	]	
// ** Init Globals
function initData(){
		
	//------- create buffers & texture
	vbuf = newBuffer("a_Position",2); // 2 coordinates per vertex
	cbuf = newBuffer("color",4); // 4 color components per vertex
	tbuf = newBuffer("texco",2); // 2 texture coordinates per vertex		
	newTex(image);
		
	
	
	//-- create player sprite
	sp.push( 
	   new Sprite(  rnd(World.hWidth),
					rnd(World.hHeight),
		            0.45,0.35,
					txPos[4] 
				  ) 
			);
	//-- create enemies sprites		
	for(let k=1;k<50;k++)
		sp.push( 
	      new Sprite(
		      rnd(World.hWidth),
			  rnd(World.hHeight),
		      0.45,0.35,
			  txPos[rndInt(0,3)]
			  )
		)
	
	//-- background	sprite
	sp.push( new Sprite(0,0,6,6,txPos[3]))    
	sp[sp.length-1].th = 0

}
	
//------------------------------------------------
function drawScene (time){
	  var dt = 0.001*(time-then)
		then=time;
		
		vArr=[]
		cArr=[]
		tArr=[]
		
		
		
		updateCamera(sp[0])
		addSpriteToBuf(sp[sp.length-1])
		drawCollisionBlocks() 
		for(let k=sp.length-2;k>0;k--){
			let r =  0.1+0.01*k
			if(rndDecide(0.01)){
				sp[k].ax=rnd(1)
				sp[k].ay=rnd(1)
			}
			 
				sp[k].vx+=sp[k].ax*dt
				sp[k].vy+=sp[k].ay*dt
				sp[k].x+=sp[k].vx*dt
				sp[k].y+=sp[k].vy*dt
				let bb = sp[k].checkCollision()
				if(undefined!=bb){
				   sp[k].ax+=0.1*(sp[k].x-bb.x)
				   sp[k].ay+=0.1*(sp[k].y-bb.y)
				   sp[k].vx*=0.5
				sp[k].vy*=0.5
				}
				sp[k].vx*=0.993
				sp[k].vy*=0.993
			 
			sp[k].detectWorldEdge()
			const rr =  0.3*(1.0+0.23*Math.sin(time*0.008))
			sp[k].width= rr
			sp[k].height=0.093/rr 
			sp[k].th+=dt*rnd(0.9,1.6)
			addSpriteToBuf(sp[k])
		}
		
		if(Mouse.btn>0){
			sp[0].ax = ( Mouse.x-sp[0].x )
			sp[0].ay = ( Mouse.y-sp[0].y )
			let v = Math.pow(sp[0].ax*sp[0].ax +sp[0].ay *sp[0].ay,0.5)
			if(v>0){
				v=0.03/v
				sp[0].ax *=v
				sp[0].ay *=v
			}
			sp[0].vx+=sp[0].ax
			sp[0].vy+=sp[0].ay
			Mouse.btn-=1
		}else{
		 sp[0].vx += 0.0005*(Key.right-Key.left) 
		 sp[0].vy += 0.0005*(Key.up-Key.down) 
		}
		
			sp[0].th =  Math.PI+ Math.atan2(sp[0].vy,sp[0].vx)  
			
			 
				
			let i=sp[0].tx[1]
			let j=sp[0].tx[3]
			
			  
			if(sp[0].vx>= 0){
				sp[0].tx[1]=Math.max(i,j)
				sp[0].tx[3]=Math.min(i,j)
			}else
				if(sp[0].vx<0)
			{
				sp[0].tx[3]=Math.max(i,j)
				sp[0].tx[1]=Math.min(i,j)
			}
			 
			
			let oldx = sp[0].x
			let oldy = sp[0].y
			 
			sp[0].x+= 0.6* sp[0].vx
			sp[0].y+= 0.6* sp[0].vy
			
			let bb = sp[0].checkCollision()
			
		    if(bb!=undefined){
				let p = sp[0]
				p.vx += 0.01 *(oldx+rnd(0.01)-p.x)
				p.vy += 0.01 *(oldy+rnd(0.01)-p.y)
				p.x  -= 0.29*(p.x-Math.round(oldx/bb.width) *bb.width)
				p.y  -= 0.29*(p.y-Math.round(oldy/bb.height)*bb.height)
			}
			
			sp[0].detectWorldEdge()
			sp[0].vx*=0.993 
			sp[0].vy*=0.993 
			const th = time*0.009
			const tt = 1.0+0.2*Math.sin(th )
			sp[0].width = 0.25*tt
			sp[0].height = 0.3/tt
		
		addSpriteToBuf(sp[0])
		setBuffer(vbuf,new  Float32Array(vArr));
		setBuffer(cbuf, new  Float32Array(cArr)) 
		setBuffer(tbuf, new  Float32Array(tArr))
		  
		// ctx.clearColor(0,0,0,1);
		// ctx.clear(ctx.COLOR_BUFFER_BIT);
		
		
		ctx.drawArrays(ctx.TRIANGLES,0,vArr.length/2);
        
    
        if(animOn){
            if(showFPS)
				results.innerHTML ="fps:"+ Math.round(1.0/(dt+0.000001));
			else results.innerHTML =""
             requestAnimationFrame(drawScene);
        }else results.innerHTML="Click To Start";
}
